import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase } from '@fortawesome/free-solid-svg-icons';
import { ProjectCard } from "../misc";
import "./portfolio.scss";
import project_trillio from "../images/project_trillio.png";
import Zoom from "react-reveal/Zoom";
import Bounce from "react-reveal/Bounce";


const Porfolio = () => {
    return (
        <div className="portfolio">
            <Bounce top cascade>
                <h1 className="title">Porfolio <span><FontAwesomeIcon icon={faBriefcase} /></span></h1>
            </Bounce>
            <Bounce>
                <p className="p1"> Below are the four most recent projects that I have worked on.</p>
            </Bounce>
            <div className="projectCard_holder">
                <Zoom right delay="500">
                    <div>
                        <ProjectCard
                            name="Trillio"
                            image={project_trillio}
                            text="This is about hiking project for a business. Anyone who like to hike can go to the website."

                        />
                    </div>
                </Zoom>

                <Zoom right delay="1000">
                    <div>
                        <ProjectCard
                            name="Trillio"
                            image={project_trillio}
                            text="This is about hiking project for a business. Anyone who like to hike can go to the website."

                        />
                    </div>
                </Zoom>


                <Zoom right delay="1500">
                    <div>
                        <ProjectCard
                            name="Trillio"
                            image={project_trillio}
                            text="This is about hiking project for a business. Anyone who like to hike can go to the website."

                        />
                    </div>
                </Zoom>

                <Zoom right delay="2000">
                    <div>
                        <ProjectCard
                            name="Trillio"
                            image={project_trillio}
                            text="This is about hiking project for a business. Anyone who like to hike can go to the website."

                        />
                    </div>
                </Zoom>
            </div>
        </div>
    );
};

export default Porfolio;
